INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 401, "アヤネ", 24, 102301, 24001, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 2.21, 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 402, "アヤネ", 24, 102301, 24002, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 403, "アヤネ", 24, 102301, 24003, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 1.99, 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 701, "アサヒ", 24, 192201, 24004, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 2.21, 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 702, "アサヒ", 24, 192201, 24005, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 3.33, 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 703, "アサヒ", 24, 192201, 24006, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 801, "部員３", 24, 192301, 24007, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 2.68, 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 802, "部員３", 24, 192301, 24008, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 803, "部員３", 24, 192301, 24009, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 1, "やった！", 1, 501, "", 24, 192501, 24010, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 1, "勝ったよ！", 1, 502, "", 24, 192501, 24011, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 1, "いい調子！", 1, 503, "", 24, 192501, 24012, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 5.33, 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 111, "ミサト", 24, 113501, 24013, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 6.85, 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 112, "ミサト", 24, 113501, 24014, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 3.0, 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 113, "ミサト", 24, 113501, 24015, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 6.11, 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 611, "ダイチ", 24, 192401, 24016, "2030/12/17 14:59:59");
