INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 613, "ダイチ", 24, 192401, 24018, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 4.52, 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 211, "ハツネ", 24, 113401, 24019, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 3.89, 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 212, "ハツネ", 24, 113401, 24020, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 13.49, 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 213, "ハツネ", 24, 113401, 24021, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 3.17, 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 311, "カヤ", 24, 106501, 24022, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 4.42, 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 312, "カヤ", 24, 106501, 24023, "2030/12/17 14:59:59");
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 2.89, 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 313, "カヤ", 24, 106501, 24024, "2030/12/17 14:59:59");
