INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("2020/07/31 12:00:00", 0.0, 0.0, 10046, 0.0, 1, "いい勝負だったよ\nまたやろうね", 1, 521, "", 24, 192501, 24028, "2030/12/17 14:59:59");
